import React from 'react';
import PostShow from './PostShow';


function PostList({posts}) {
  return (
    <div>
   {
    posts.map((post)=>{
      return (
        <PostShow key={post.id} post={post}/>
      )
    })
   }
    </div>
  )
}

export default PostList;
